import React from 'react'

const Main = ({title}) => (
    <li>
        <div> {title} </div>
    </li>
)

const MainNews = () => {
    const newsList = ['aa', 'bb', 'cc']

    return (
        <ol>
            {newsList.map( ( title, index) => (
                <Main key={index} title={title}/>
            ))}
        </ol>
    )
}
export default MainNews
